import React from 'react';
// import Avatar from '@material-ui/core/Avatar';
// import Button from '@material-ui/core/Button';
// import CssBaseline from '@material-ui/core/CssBaseline';
import TextField from '@material-ui/core/TextField';
// import FormControlLabel from '@material-ui/core/FormControlLabel';
// import Checkbox from '@material-ui/core/Checkbox';
// import Link from '@material-ui/core/Link';
// import Grid from '@material-ui/core/Grid';
// import Box from '@material-ui/core/Box';
// import LockOutlinedIcon from '@material-ui/icons/LockOutlined';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import StuTeacher from './StuTeacher';

const useStyles = makeStyles((theme) => ({
  paper: {
    marginTop: theme.spacing(8),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    backgroundColor: 'brown',
    // position: 'center'
  },
  avatar: {
    // margin: theme.spacing(5),
    margin: theme.spacing(3, 0, 2),

    backgroundColor: theme.palette.secondary.main,
  },
  form: {
    width: '100%', // Fix IE 11 issue.
    marginTop: theme.spacing(1),
  },
  submit: {
    margin: theme.spacing(3, 0, 2),
  },
}));

export default function Login({handleResult, pwd}) {
  const classes = useStyles();

const handleChange = (event) => {
    if (event.target.value.toLowerCase() === pwd){
        handleResult(true);
    }
  };

  return (
    <>

    {/* <StuTeacher/> */}

    <Container component="main" maxWidth="xs" style={{backgroundColor: "brown", position: 'center'}}>
      <div className={classes.paper}>
        {/* <Avatar className={classes.avatar}> */}
          {/* <LockOutlinedIcon /> */}
          <img src="./images/barmit.png" alt="icon" loading="lazy" height='auto'/>

        {/* </Avatar> */}
        {/* <img src="./images/ShemaPic.png" alt="Shema" loading="lazy"  height='auto'/> */}
        <Typography component="h1" variant="h5" style={{color: "white"}}>
          Begin your Journey 
        </Typography>
          <TextField
            variant="outlined"
            color="secondary"
            margin="normal"
            fullWidth
            name="password" label="Password"
            type="password"
            // id="password"
            onChange={handleChange}
            style={{color: "white"}}
            autoComplete="current-password"
          />
      </div>
       </Container>

       </>

  );
}
